import React, { useState } from 'react';
import { ChevronDown, ChevronUp } from 'lucide-react';

const ListView = ({ incidents, getCategoryEmoji }) => {
  const [expandedId, setExpandedId] = useState(null);

  const getTimeAgo = (date) => {
    const seconds = Math.floor((new Date() - new Date(date)) / 1000);

    if (seconds < 60) return 'Just now';
    if (seconds < 3600) return `${Math.floor(seconds / 60)} min ago`;
    if (seconds < 86400) return `${Math.floor(seconds / 3600)} hr ago`;
    return `${Math.floor(seconds / 86400)} days ago`;
  };

  const getUrgencyColor = (urgency) => {
    const colors = {
      low: 'bg-emerald-100 text-emerald-700 border-emerald-300',
      medium: 'bg-amber-100 text-amber-700 border-amber-300',
      high: 'bg-rose-100 text-rose-700 border-rose-300'
    };
    return colors[urgency] || 'bg-slate-100 text-slate-700 border-slate-300';
  };

  const sortedIncidents = [...incidents].sort((a, b) => 
    new Date(b.timestamp) - new Date(a.timestamp)
  );

  if (incidents.length === 0) {
    return (
      <div data-testid="list-view" className="flex items-center justify-center h-96">
        <div className="text-center">
          <div className="text-6xl mb-4">üó∫Ô∏è</div>
          <h3 className="text-xl font-semibold text-slate-700 mb-2">No Incidents Reported</h3>
          <p className="text-slate-500">The area is clear. Be the first to report if you see something.</p>
        </div>
      </div>
    );
  }

  return (
    <div data-testid="list-view" className="p-6 max-h-[600px] overflow-y-auto">
      <div className="space-y-4">
        {sortedIncidents.map((incident) => (
          <div
            key={incident.id}
            data-testid={`incident-${incident.id}`}
            className="bg-white border border-slate-200 rounded-xl p-4 hover:shadow-lg transition-all"
          >
            <div className="flex items-start justify-between">
              <div className="flex items-start space-x-3 flex-1">
                <div className="text-3xl">{getCategoryEmoji(incident.category)}</div>
                <div className="flex-1">
                  <div className="flex items-center gap-2 mb-2">
                    <h3 className="text-lg font-bold text-slate-900">
                      {incident.category.toUpperCase()}
                    </h3>
                    <span className={`px-2 py-1 rounded-full text-xs font-semibold border ${getUrgencyColor(incident.urgency)}`}>
                      {incident.urgency.toUpperCase()}
                    </span>
                    {incident.is_verified ? (
                      <span className="px-2 py-1 rounded-full text-xs font-semibold bg-emerald-100 text-emerald-700 border border-emerald-300">
                        ‚úì Verified
                      </span>
                    ) : (
                      <span className="px-2 py-1 rounded-full text-xs font-semibold bg-amber-100 text-amber-700 border border-amber-300">
                        ‚ö† Unverified
                      </span>
                    )}
                  </div>

                  <div className="flex items-center gap-4 text-sm text-slate-600 mb-2">
                    <span>{getTimeAgo(incident.timestamp)}</span>
                    {incident.cluster_count > 1 && (
                      <span className="text-rose-600 font-semibold">
                        {incident.cluster_count} reports in area
                      </span>
                    )}
                  </div>

                  {expandedId === incident.id && (
                    <div className="mt-3 pt-3 border-t border-slate-200">
                      <p className="text-slate-700">{incident.description}</p>
                      <div className="mt-2 text-xs text-slate-500">
                        Location: {incident.latitude.toFixed(4)}, {incident.longitude.toFixed(4)}
                      </div>
                    </div>
                  )}
                </div>
              </div>

              <button
                data-testid={`expand-incident-${incident.id}`}
                onClick={() => setExpandedId(expandedId === incident.id ? null : incident.id)}
                className="ml-2 p-2 hover:bg-slate-100 rounded-lg transition-colors"
              >
                {expandedId === incident.id ? (
                  <ChevronUp className="w-5 h-5 text-slate-600" />
                ) : (
                  <ChevronDown className="w-5 h-5 text-slate-600" />
                )}
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ListView;
